import React from 'react';
import ContactForm from '../components/ContactForm';

class ShowAnimal extends React.Component {
  state = {
    name: '',
    age: '',
    breed: '',
    color: '',
    size: '',
    gender: '',
    street_address: '',
    city: '',
    zip: '',
    state: '',
    email: '',
    phone: ''
  };

  componentDidMount() {
    console.log(this.props.match.params);
    fetch(`/api/animals/${this.props.match.params.id}`)
      .then(response => response.json())
      //   .then(data => console.log(data));
      .then(data =>
        this.setState({
          name: data.name,
          age: data.age,
          breed: data.breeds.primary,
          color: data.colors.primary,
          size: data.size,
          gender: data.gender,
          street_address: data.contact.address.address1,
          city: data.contact.address.city,
          state: data.contact.address.state,
          zip: data.contact.address.postcode,
          email: data.contact.email,
          phone: data.contact.phone,
          photo: data.image
        })
      );
  }

  render() {
    return (
      <i className="block">

        <i>{this.state.name}</i>
        <i>{this.state.age}</i>
        <i>{this.state.breed}</i>
        <i>{this.state.color}</i>
        <i>{this.state.size}</i>
        <i>{this.state.gender}</i>
        <i>{this.state.street_address}</i>
        <i>{this.state.city}</i>
        <i>{this.state.state}</i>
        <i>{this.state.zip}</i>
        <i>{this.state.email}</i>
        <i>{this.state.phone}</i>
        <i>{this.state.photo}</i>

        <ContactForm />
      </i>
    );
  }
}

export default ShowAnimal;

